import React, { useState } from "react";
import Header from "./components/Header";
import Sidebar from "./components/Sidebar";
import Dashboard from "./components/Dashboard";

const App = () => {
  const [selectedOrder, setSelectedOrder] = useState(null); // Manage order selection

  return (
    <div className="bg-gray-900 text-white min-h-screen p-5">
      {/* Header */}
      <Header />

      <div className="flex mt-5">
        {/* Sidebar with setter function */}
        <Sidebar setSelectedOrder={setSelectedOrder} />

        {/* Dashboard with selected order */}
        <Dashboard selectedOrder={selectedOrder} />
      </div>
    </div>
  );
};

export default App;
